import React from 'react'
import {withOktaAuth} from "@okta/okta-react";


export default withOktaAuth(class Admin extends React.Component{

    componentDidMount() {
        this.fetchCurrentUsers()
    }

    fetchCurrentUsers = () => {
        const packet = {
            cache: "no-cache",
            credentials: "include",
            method: "GET",
            headers: {
                "Content-Type": "application/json",
                "Accept": "application/json",
            },
        }

        fetch("https://dev-49794790.okta.com/api/v1/users/", packet)
            .then(res => res.json())
            .then(users => this.renderUsers(users))
    }

    renderUsers = (users) => {
        users.map(user => console.log(user))
    }

    render() {
        return(
            <div>
                <h3>User Administration</h3>
            </div>


        )
    }
})
